export const toc = [];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Purpose`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Syntax`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonget"
                }}>{`JSON.GET`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Return the value at path in JSON serialized form`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.GET `}{`<`}{`key`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonset"
                }}>{`JSON.SET`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Sets the JSON value at path in key`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.SET `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`json`}{`>`}{` `}{`[NX `}{`|`}{` XX]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "hTtps://oss.redislabs.com/redisjson/commands/#jsonmget"
                }}>{`JSON.MGET`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Returns the values at path from multiple key`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.MGET `}{`<`}{`key`}{`>`}{` `}{`[key ...]`}{` `}{`<`}{`path`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsontype"
                }}>{`JSON.TYPE`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Report the type of JSON value at path .`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.TYPE `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonnumincrby"
                }}>{`JSON.NUMINCRBY`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Increments the number value stored at path by number`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.NUMINCRBY `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`number`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonnummultby"
                }}>{`JSON.NUMMULTBY`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Multiplies the number value stored at path by number`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.NUMMULTBY `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`number`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonstrappend"
                }}>{`JSON.STRAPPEND`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Append the json-string value(s) the string at path`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.STRAPPEND `}{`<`}{`key`}{`>`}{`  `}{`[path]`}{` `}{`<`}{`json-string`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrappend"
                }}>{`JSON.ARRAPPEND`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Append the json value(s) into the array at path after the last element in it`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRAPPEND `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`json`}{`>`}{`  `}{`[json ...]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonstrlen"
                }}>{`JSON.STRLEN`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Report the length of the JSON String at path in key`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.STRLEN `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrlen"
                }}>{`JSON.ARRLEN`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Report the length of the JSON Array at path in key`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRLEN `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrinsert"
                }}>{`JSON.ARRINSERT`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Insert the json value(s) into the array at path before the index (shifts to the right)`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRINSERT `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`index`}{`>`}{` `}{`<`}{`json`}{`>`}{` `}{`[json ...]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrindex"
                }}>{`JSON.ARRINDEX`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Search for the first occurrence of a scalar JSON value in an array`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRINDEX `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`json-scalar`}{`>`}{` [start `}{`[stop]`}{`]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrpop"
                }}>{`JSON.ARRPOP`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Remove and return element from the index in the array`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRPOP `}{`<`}{`key`}{`>`}{`  [path `}{`[index]`}{`]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonarrtrim"
                }}>{`JSON.ARRTRIM`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Trim an array so that it contains only the specified inclusive range of elements`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.ARRTRIM `}{`<`}{`key`}{`>`}{` `}{`<`}{`path`}{`>`}{` `}{`<`}{`start`}{`>`}{` `}{`<`}{`stop`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonobjkeys"
                }}>{`JON.OBJKEYS`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Return the keys in the object that's referenced by path`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.OBJKEYS `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonobjlen"
                }}>{`JSON.OBJLEN`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Report the number of keys in the JSON Object at path in key`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.OBJLEN `}{`<`}{`key`}{`>`}{` `}{`[path]`}{` `}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsondebug"
                }}>{`JSON.DEBUG`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Report information`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.DEBUG `}{`<`}{`subcommand & arguments`}{`>`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonresp"
                }}>{`JSON.RESP`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Return the JSON in key in Redis Serialization Protocol (RESP)`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.RESP `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><button><b><a parentName="td" {...{
                  "href": "https://oss.redislabs.com/redisjson/commands/#jsonforget"
                }}>{`JSON.FORGET`}</a></b></button></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`An Alias for `}<a parentName="td" {...{
              "href": "https://oss.redislabs.com/redisjson/commands/#jsondel"
            }}>{`JSON.DEL`}</a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}><code>{`JSON.DEL `}{`<`}{`key`}{`>`}{` `}{`[path]`}</code></td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
